const initialState = {
  rooms: [
    { id: 1, ableToCheck: false },
    { id: 2, ableToCheck: true, checked: false },
    { id: 3, ableToCheck: true, checked: false },
    { id: 4, ableToCheck: true, checked: false }
  ]
};

export default (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
